import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import MainSection from "./components/Main";
import AccountPage from "./components/Account";
import PaymentPage from "./components/Payment";
import Details from "./components/Details";
import { Route, BrowserRouter } from "react-router-dom";
import Footer from "./components/Footer";
import NavBar from "./components/Navbar";
import React from "react";
import Registration from "./components/Registration";

function App() {
  const [searchQuery, setSearchQuery] = React.useState("");

  const updateSearchQuery = (query) => setSearchQuery(query);

  return (
    <div className="App">
      <BrowserRouter>
        <NavBar handleSearchQuery={updateSearchQuery} />
        <Route
          path="/"
          exact
          render={() => <MainSection searchQuery={searchQuery} />}
        />
        <Route path="/account" component={AccountPage} exact />
        <Route path="/payment" component={PaymentPage} exact />
        <Route path="/details/:id" component={Details} exact />
        <Route path="/registration" component={Registration} exact />
        <Route
          path="/registrationData"
          exact
          render={(props) => <RegistrationData title="Stefano" {...props} />}
        />

        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
